import React from "react";

const ExposicaoProjetos = () => {
  return (
    <div className="exposicao-container">
      <h2>Exposição por Projetos</h2>
      <p>Em breve serão exibidos gráficos e informações detalhadas sobre exposição do fundo.</p>
    </div>
  );
};

export default ExposicaoProjetos;
